import styled, { css } from 'styled-components'

export const Wrapper = styled.div`
  display: flex;
  flex-direction: row;
  font-size: 20px;
  align-items: center;
  justify-content: center;
  float: right;
  margin-top: -45px;
  gap: 5px;
  cursor: pointer;
`
export const EditWrapper = styled.div`
  color: #327aed;
  ${({ styleProps }) => css`
    position: relative;
    top: ${styleProps.positionTop};
  `}
`
export const TrashWrapper = styled.div`
  color: #ba1b13;
`
